pragma solidity >=0.4.22 < 0.8.20;

contract main {

    p2p p2p_contract;

    constructor (p2p peer2peer) {
        p2p_contract = peer2peer;
    }

    function registerProsumer() public noProsumerExists {
        // msg.sender
        p2p_contract.addNewProsumer();
    }

    function deposit() public prosumerExists payable{
        // msg.value is the deposit value
        // modifier checks that the user actually exists
        p2p_contract.setEtherBalance(msg.value/10e18);    
    }


    function withdraw() public prosumerExists  hasPositiveEnergyBalance payable{
        // users can only withdraw if they have an energy balance >= 0
        if(checkEnergyStatus()>=0){
            // withdraw
            payable(msg.sender).transfer(checkEtherStatus()*10e18);
        }

    }
    function checkEtherStatus() public view prosumerExists returns (uint){
        // msg.value is the deposit value
        // modifier checks that the user actually existss
        return p2p_contract.getEtherBalance();
    }

    function checkEnergyStatus() public view prosumerExists returns (int){
        // modifier checks that the user actually existss
        return p2p_contract.getEnergyBalance();
    }

    function buyEnergy(int energy) public prosumerExists buyerHasEnoughEthers(uint(energy)) {
        p2p_contract.buyEnergy(energy);
    }

    function sellEnergy(int energy) public prosumerExists sellerHasEnoughEnergy(energy){
        p2p_contract.sellEnergy(energy);
    }

    function energyRequest(int energy) public prosumerExists  {

        if (energy > 0){
            //if someone has positive energy balance they wanna sell
            sellEnergy(energy);
        } else {
            //if someone has negative energy balance they wanna buy
            buyEnergy(energy);
        }
    }

    function setEnergyStatus(int energy) public prosumerExists {
        p2p_contract.setEnergyBalance(energy);
    }

    // function getEnergyStatus() public prosumerExists {
    //     p2p_contract.getEnergyBalance();
    // }

    modifier prosumerExists() {
        require(p2p_contract.getId() != address(0), "This prosumer already exists.");
        _;
    }

    modifier noProsumerExists() {
        require(p2p_contract.getId() == address(0), "This prosumer does not exist.");
        _;
    }

    modifier buyerHasEnoughEthers(uint ethers) {

        require(p2p_contract.getEtherBalance() >= ethers,"This buyer does not have enough ethers.");
        _;
    }

    modifier sellerHasEnoughEnergy(int energy){
        require(p2p_contract.getEnergyBalance()>=energy, "This seller is trying to sell energy it does not have.");
        _;
    }

    modifier hasPositiveEnergyBalance(){
        require(p2p_contract.getEnergyBalance()>=0, "This buyer has a negative energy balance and cannot withdraw.");
        _;
    }


}


contract p2p {
    struct Prosumer {
        address id;
        int energyBalance;
        uint etherBalance;
    }

    mapping (address=>Prosumer) prosumers;
    address[] listOfProsumers;

    function addNewProsumer() public {
        // prosumer = Prosumer(msg.sender,0,0);
        prosumers[msg.sender] = Prosumer(msg.sender,0,0);
        listOfProsumers.push(msg.sender);
    }

    function buyEnergy(int energy) public {
        // iterate over listOfProsumers
        // find someone that has positive energy balance and transfer
        for (uint i = 0; i<listOfProsumers.length; i++){
            //they are a seller
            if(prosumers[listOfProsumers[i]].energyBalance>0){
                    // if prosumer we are on has enough energy to sell to cover our transaction do it all
                if (prosumers[listOfProsumers[i]].energyBalance>=energy){

                    // increase our energy balance
                    prosumers[msg.sender].energyBalance += energy;

                    // decrease their energy balance
                    prosumers[listOfProsumers[i]].energyBalance -= energy;

                    // increase their ether balance
                    prosumers[msg.sender].etherBalance += uint(energy);

                    // decrease our ether balance
                    prosumers[listOfProsumers[i]].etherBalance -= uint(energy);

                    break;
                    //break loop as no more buying needs to occur

                //if prosumer can sell less energy than we need but can sell some
                } else if (energy>prosumers[listOfProsumers[i]].energyBalance){

                    // update how much energy we still want to buy
                    energy -= prosumers[listOfProsumers[i]].energyBalance;

                    // increase our energy balance by their energy balance
                    prosumers[msg.sender].energyBalance += prosumers[listOfProsumers[i]].energyBalance;

                    // decrease our ether balance by how much we bought
                    prosumers[msg.sender].etherBalance -= uint(prosumers[listOfProsumers[i]].energyBalance);

                    // increase their ether balance to how much they sold
                    prosumers[listOfProsumers[i]].etherBalance += uint(prosumers[listOfProsumers[i]].energyBalance);

                    // decrease their energy balance to zero
                    prosumers[listOfProsumers[i]].energyBalance = 0;

                }
            }



        }
    }

    function sellEnergy(int energy) public {

        //check that we can sell this much energy

        for (uint i = 0; i<listOfProsumers.length; i++){
            // //they want to buy and have enough ethers to do so
            if (prosumers[listOfProsumers[i]].energyBalance<0 ){

                int amountTheyCanBuy = prosumers[listOfProsumers[i]].energyBalance;
                // //check whether they have less ethers than they do a need for energy
                // //this means that we cannot sell them how much energy we need but only some.
                // if((-prosumers[listOfProsumers[i]].energyBalance)>prosumers[listOfProsumers[i]].etherBalance){
                //     //they do not have enough ethers to pay for all the energy they want
                //     amountTheyCanBuy = prosumers[listOfProsumers[i]].etherBalance;
                // } else {
                //     //they have enough ethers so the amount they can buy is the negative of their negative energy balance
                //     // energy balance = -6
                //     // amount they can buy = +6
                //     amountTheyCanBuy = -prosumers[listOfProsumers[i]].energyBalance;
                // }




                // they want to buy all the energy we are selling
                // if the prosumers energy balance is enough 
                if(amountTheyCanBuy>=energy){

                    // increase their energy balance
                    // decrease their ether balance
                    // increase our ether balance
                    // decrease our energy balance

                    prosumers[listOfProsumers[i]].energyBalance+=energy;
                    prosumers[listOfProsumers[i]].etherBalance-=uint(energy);

                    prosumers[msg.sender].energyBalance -= energy;
                    prosumers[msg.sender].etherBalance += uint(energy);

                //if the energy they want to to buy is less than what we want to sell but we still will sell them some


                // they do not wanna buy all the energy we wanna sell (their energy balance is bigger than -energy)
                // prosumers[listOfProsumers[i]].energyBalance>-energy 

                // and they have enough money to cover this transaction
                //  && prosumers[listOfProsumers[i]].etherBalance>prosumers[listOfProsumers[i]].energyBalance

                } else if (amountTheyCanBuy<energy ){

                    //give them all the energy they want to buy.
                    //  minus the energy we want to sell by their absolute balance, this means that our positive energy value goes down
                    // energy -= abs(prosumers[listOfProsumers[i]].energyBalance);

                    //amount we are still looking to sell goes down by amountTheyCanBuy
                    energy-=amountTheyCanBuy;
                    //amount of energy we have goes down by amountTheyCanBuy
                    prosumers[msg.sender].energyBalance -= amountTheyCanBuy;

                    //our ether balance goes up by how much we sold
                    prosumers[msg.sender].etherBalance += uint(amountTheyCanBuy);

                    // their ether balance goes down by how much they bought
                    prosumers[listOfProsumers[i]].etherBalance-=uint(amountTheyCanBuy);

                    // their energy balance goes up by how much they bought
                    prosumers[listOfProsumers[i]].energyBalance+=amountTheyCanBuy;
                }
            }
        }
    }

    function getEnergyBalance() public view returns (int) {
        return prosumers[msg.sender].energyBalance;
    }

    function setEnergyBalance(int energy) public {
        prosumers[msg.sender].energyBalance=energy;
    }

    function getEtherBalance() public view returns (uint) {
        return prosumers[msg.sender].etherBalance;
    }

    function getId() public view returns (address) {
        return prosumers[msg.sender].id;
    }

    function setEtherBalance(uint ethers) public {
        prosumers[msg.sender].etherBalance=ethers;
    }

}
